import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const BackTo = ({ children }) => {
  return (
    <Fragment>
      <Link
        className="border border-violet-700 rounded-md px-4 py-3"
        to={"/login"}
      >
        <p className="font-normal">{children}</p>
      </Link>
    </Fragment>
  );
};

export default BackTo;
